description:
Tintin's friend Professor Calculus has been secretly commissioned by the Syldavian government to build a rocket ship that will fly from the Earth to the Moon. Tintin and Captain Haddock agree to join the expedition, even though Captain Haddock shows considerable reluctance. Upon arriving in Syldavia, they are taken to the Sprodj Atomic Research Centre, called simply &quot;the Centre&quot;, headed by the scientist Mr. Baxter.  While working for Syldavia, Calculus is assisted by engineer Frank Wolff, who works in the Centre, and accompanies Tintin and Haddock around the facility. The Centre is entirely dedicated to peaceful uses of nuclear energy. Calculus heads the Centre's astronautics department, since this is his primary area of expertise.  Of course, there is mischief about...
